    // </div>
    // </>
    <>

    <Navbar/>
    <BrowserRouter>
    <Routes>
      <Route path='/Navbar' element={<Navbar/>}></Route>
      <Route path='/Hero' element={<Hero/>}></Route>
      <Route path='/Skills' element={<Skills/>}></Route>
      <Route path='/Contact' element={<C/>}></Route>
    </Routes>
    </BrowserRouter>
    </>
  );
}

export default App;
